import React from "react";
import { NavLink } from "react-router-dom";
import NavBar from "../components/Common/NavBar";
import {motion} from 'framer-motion';
import styled from "styled-components";

export default function HomeBeforeLogin() {
    const variants = {
        start: { pathLength: 0, fill: "rgba(255, 255, 255,0)" },
        end: { pathLength: 1, fill: "rgba(255,255,255,1)" }
      };
    return(
        <>
            <div>
                <NavBar>
                    <div><NavLink to='/'></NavLink></div>
                </NavBar>
            </div>
            <div style={{position: 'relative', margin: 0}}>
                <img alt="chicken" src="img/배경.png" style={{width: '100%', height: '650px', marginBottom: '0px'}} ></img>
                <div style={{position: 'absolute', top: "50px"}}>
                <motion.div
            variants={variants}
            initial="start"
            animate="end"
            transition={{
              default: { duration: 1.8 },
              fill: { duration: 1, delay: 1.1 }
            }}
            d="M318.7 268.7c-.2-36.7 16.4-64.4 50-84.8-18.8-26.9-47.2-41.7-84.7-44.6-35.5-2.8-74.3 20.7-88.5 20.7-15 0-49.4-19.7-76.4-19.7C63.3 141.2 4 184.8 4 273.5q0 39.3 14.4 81.2c12.8 36.7 59 126.7 107.2 125.2 25.2-.6 43-17.9 75.8-17.9 31.8 0 48.3 17.9 76.4 17.9 48.6-.7 90.4-82.5 102.6-119.3-65.2-30.7-61.7-90-61.7-91.9zm-56.6-164.2c27.3-32.4 24.8-61.9 24-72.5-24.1 1.4-52 16.4-67.9 34.9-17.5 19.8-27.8 44.3-25.6 71.9 26.1 2 49.9-11.4 69.5-34.3z"
                ></motion.div></div>
            </div>
            <div style={{position: 'relative', marginTop: '0'}}>
                <img alt="chicken" src="img/배경2.png" style={{width: '100%', marginTop: '0px', padding: '0px', }} ></img>
            </div>
        </>
    )
}

const Img= styled.img`
    width: 500px;
    height: auto;
`
